export const addVehicle = vehicle => {
  return {
    type: "ADD_VEHICLE",
    payload: vehicle
  };
};

export const sorting = (model_name, sortType) => {
  return {
    type: sortType,
    payload: model_name
  };
};

export const deleteVehicle = (id)=>{
  return {
    type:"DELETE",
    id:id
  }
}
